import React from 'react'
import {Jumbotron} from 'react-bootstrap'

export default function Header({headText}) {
   return (
      <Jumbotron className="headerStyle text-monospace">
         <h1 className="text-center text-white text-uppercase font-weight-bold">{headText}</h1>
      </Jumbotron>
   )
}

